import axios from 'axios';
import React, { useState } from 'react';

function Signup() {
    const [formData, setFormData] = useState({
        first_name: '',
        last_name: '',
        email: '',
        username: '',
        password: '',
        confirm_password: '',
        gender: '',
        agreeToTerms: false,
    });

    const handleChange = (event) => {
        const { name, value, type, checked } = event.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: type === 'checkbox' ? checked : value,
        }));
    };

    const handleSubmit = async (event) => {
        event.preventDefault(); // Prevent the default form submission behavior
        try {
            // Send the signup request
            const response = await axios.post('http://127.0.0.1:8000/signup/', formData, { withCredentials: true });
            console.log('Signup successful:', response.data);
            alert(response.data.message); // Alert the success message
        } catch (error) {
            console.log(error.response.data.message)
            let error_message = "";
            if (error.response?.data?.errors) {
                for (let key in error.response.data.message) {
                    error_message += `${key}: ${error.response.data.errors[key].join(', ')}\n`;
                }
            } else {
                error_message = error.response?.data?.message || 'An error occurred during signup.';
            }
            alert(error_message);
        }
    };

    return (
        <div className="col container custom_signup">
            <form className="row g-3" onSubmit={handleSubmit}>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">First Name</div>
                    <input
                        type="text"
                        className="form-control"
                        name="first_name" // Corrected this line
                        value={formData.first_name}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Last Name</div>
                    <input
                        type="text"
                        className="form-control"
                        name="last_name" // Corrected this line
                        value={formData.last_name}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Email</div>
                    <input
                        type="email"
                        className="form-control"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Username</div>
                    <input
                        type="text"
                        className="form-control"
                        name="username"
                        value={formData.username}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Password</div>
                    <input
                        type="password"
                        className="form-control"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Confirm Password</div>
                    <input
                        type="password"
                        className="form-control"
                        name="confirm_password" // Corrected this line
                        value={formData.confirm_password}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Gender</div>
                    <select
                        name="gender"
                        className="form-select"
                        value={formData.gender}
                        onChange={handleChange}
                        required
                    >
                        <option value="">Choose...</option>
                        <option value="M">Male</option>
                        <option value="F">Female</option>
                        <option value="O">Other</option>
                    </select>
                </div>
                <div className="col-12">
                    <div className="form-check text-start fw-bold">
                        <input
                            className="form-check-input border"
                            type="checkbox"
                            name="agreeToTerms" // Keep this line for checkbox handling
                            checked={formData.agreeToTerms}
                            onChange={handleChange}
                            required
                        />
                        <label className="form-check-label text-start" htmlFor="gridCheck">
                            Check this
                        </label>
                    </div>
                </div>
                <div className="col-12 text-start">
                    <button type="submit" className="btn btn-primary col-12">
                        Sign Up
                    </button>
                </div>
            </form>
        </div>
    );
}

export default Signup;
